(142, 1, '2022-11-17 15:04:13', '2022-11-17 08:04:13', '<div class=\"featureContent_col-1\">\r\n<div class=\"featureContent_col_wrap\">\r\n<h3 class=\"featureContent_title\">Thiết kế hiện đại</h3>\r\n<article class=\"featureContent_caption\"><a href=\"https://www.nguyenkim.com/tai-nghe-vi-tinh-microlab-k-250.html\" target=\"_blank\" rel=\"noopener noreferrer\">Tai nghe Microlab K-250</a> với kiểu dáng chuyên dụng, tạo cảm giác ôm sát tai làm giảm đáng kể tiếng ồn từ bên ngoài và làm giảm chất lượng âm thanh.</article><article><img src=\"https://cdn.nguyenkimmall.com/images/detailed/259/10012978-tai-nghe-vi-tinh-microlab-k-250-1.jpg\" alt=\"tai-nghe-vi-tinh-microlab-k-250-1\" /></article></div>\r\n</div>\r\n<div class=\"featureContent_col-2\">\r\n<h2>Đặc điểm nổi bật</h2>\r\n<ul>\r\n 	<li class=\"short-descr-col-1\">Kiểu dáng chuyên dụng, ôm sát tai, hạn chế tạp âm bên ngoài</li>\r\n 	<li class=\"short-descr-col-1\">Đệm tai nghe êm ái, không gây khó chịu khi đeo lâu</li>\r\n 	<li class=\"short-descr-col-1\">Jack cắm 3.5mm tương thích với nhiều dòng máy tính khác nhau</li>\r\n 	<li class=\"short-descr-col-1\">Dây cáp dài, dễ dàng kết nối với máy tính ở khoảng cách xa</li>\r\n 	<li class=\"short-descr-col-1\">Chức năng ghi âm tiện lợi, thoái mái trò chuyện cùng bạn bè</li>\r\n</ul>\r\n</div>', 'tai nghe', '', 'publish', 'open', 'open', '', 'tai-nghe', '', '', '2022-11-17 15:04:13', '2022-11-17 08:04:13', '', 0, 'http://localhost:8000/wordpress/?post_type=sanpham&#038;p=142', 0, 'sanpham', '', 0),
