(294, 1, '2022-11-24 13:59:47', '2022-11-24 06:59:47', 'Nếu bạn có làn da khô, lão hóa, da hỗn hợp thiên khô, da nhạy cảm và dễ bị kích ứng, hoặc da hư tổn sau các liệu trình thẩm mỹ, thì đừng bỏ lỡ “siêu phẩm” này nhé!\r\n<table class=\"picture\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td class=\"pic\"><img class=\"cms-photo lazyloaded\" src=\"https://image.thanhnien.vn/w2048/Uploaded/2022/urwqwc-zl/2022_02_21/mh-2-2631.jpg\" alt=\"Top 10 kem dưỡng ẩm cho làn da láng mịn ngay lần đầu sử dụng - ảnh 2\" data-image-id=\"3750040\" data-width=\"1200\" data-height=\"1118\" data-src=\"https://image.thanhnien.vn/w2048/Uploaded/2022/urwqwc-zl/2022_02_21/mh-2-2631.jpg\" /></td>\r\n</tr>\r\n<tr>\r\n<td class=\"caption\">Image Vital C Hydrating Intense Moisturizer</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<strong>Thành phần chính:</strong> L- ascorbic acid (vitamin C ổn định), Hyaluronic acid (HA), Vitamin E, chiết xuất hạt nho, trà xanh, chồi Ô liu, chiết xuất dầu từ quả cam ngọt…\r\n\r\n<strong>Ưu điểm nổi bật:</strong>\r\n\r\n● Thiết kế bắt mắt dạng chai hình trụ nhỏ gọn, có tông màu trắng - cam. Có nắp đóng mở chắc và vòi nhấn tiện lợi, giúp lấy kem dễ dàng và tránh làm sản phẩm bị ôxy hóa.\r\n\r\n● Chất kem khá đặc, có', 'Kem dưỡng da Pure Retino', '', 'publish', 'open', 'open', '', 'kem-duong-da-pure-retino', '', '', '2022-11-24 13:59:47', '2022-11-24 06:59:47', '', 0, 'http://localhost:8000/wordpress/?p=294', 0, 'post', '', 0),
