(323, 1, '2022-11-25 10:20:52', '2022-11-25 03:20:52', '<div id=\"HEADLINE37\" class=\"ladi-element\">\r\n<h2 class=\"ladi-headline\">VINHOMES SMART CITY</h2>\r\n</div>\r\n<div id=\"PARAGRAPH39\" class=\"ladi-element\">\r\n<p class=\"ladi-paragraph\">Chính thức ra mắt thị trường vào tháng 4 năm 2019, Vinhomes Smart City sở hữu trọn vẹn mọi ưu điểm của dự án tiền thân Vincity Sportia, một đại đô thị trẻ, năng động bậc nhất Thủ đô. Không chỉ thế, với hàng loạt giải pháp công nghệ hiện đại, toàn diện, dự án còn được nâng cấp trở thành Đại đô thị thông minh năng động chưa từng có tại Việt Nam. Nơi đây hứa hẹn sẽ trở thành không gian đáng sống nhất, dành riêng cho các cộng đồng cư dân hiện đại, đẳng cấp.</p>\r\n\r\n</div>\r\n<div id=\"PARAGRAPH40\" class=\"ladi-element\">\r\n<p class=\"ladi-paragraph\">· Tên dự án: Vinhomes Smart City\r\n· Vị trí: Tây Mỗ – Đại Mỗ, Nam Từ Liêm, Hà Nội\r\n· Quy mô dự án: 280 ha\r\n· Mật độ xây dựng: 14,7%</p>\r\n<p class=\"ladi-paragraph\"><img class=\"alignnone size-medium wp-image-267\" src=\"http://localhost:8000/wordpress/wp-content/uploads/2022/11/logo-300x199.png\" alt=\"\" width=\"300\" height=\"199\" />·</p>\r\n<p class=\"ladi-paragraph\">3 dòng sản phẩm: Vinhomes Sapphire, Vinhomes Ruby, Vinhomes Diamond\r\n· Chiều cao trung bình mỗi tòa nhà: 35 – 39 tầng\r\n· Diện tích thiết kế mỗi căn hộ: 32 – 75m2\r\n· Sản phẩm: 58 tòa chung cư, 98 căn biệt thự\r\n· Thời gian xây dựng và hoàn thiện: 2018 – 2022</p>\r\n\r\n</div>', 'dự án 1', '', 'publish', 'open', 'open', '', 'du-an-1', '', '', '2022-11-29 09:33:49', '2022-11-29 02:33:49', '', 0, 'http://localhost:8000/wordpress/?post_type=project&#038;p=323', 0, 'project', '', 0),
