(358, 1, '2022-11-25 13:41:51', '2022-11-25 06:41:51', '<div>\r\n<div> [project_shortcode]</div>\r\n</div>\r\n<strong>Xất xứ: Hàn Quốc</strong>\r\n\r\n<strong>Trọng lượng: 4.4gr</strong>\r\n\r\nLà son kem lì của thương hiệu Romand có chất son xốp mịn, độ lên màu chuẩn, dễ tán đều trên môi cùng bảng màu ngọt ngào, mùi thơm dịu nhẹ tựa ly trà sữa hương socola ngọt ngào, êm dịu cho bạn đôi môi ngọt ngào, xinh xắn thu hút mọi ánh nhìn.\r\n\r\n<a title=\" Son Kem Romand Milk Tea Velvet Tint Ver.2 4.4gr hình ảnh 1\" href=\"https://beautygarden.vn/Upload/tinymce/2022/5/17/son-kem-romand-milk-tea-velvet-tint-ver2-0-hinh-anh-1.jpg\" target=\"_blank\" rel=\"noopener\"><img class=\"lazy\" src=\"https://adminbeauty.hvnet.vn/Upload/tinymce/2022/5/17/son-kem-romand-milk-tea-velvet-tint-ver2-0-hinh-anh-1.jpg\" alt=\"son kem romand milk tea velvet tint ver2 hinh anh 1\" width=\"640\" height=\"640\" data-src=\"https://adminbeauty.hvnet.vn/Upload/tinymce/2022/5/17/son-kem-romand-milk-tea-velvet-tint-ver2-0-hinh-anh-1.jpg\" /></a>\r\n\r\n<em>Son Romand Milk Tea Velvet Tint với thiết kế ngọt ngào mê đắm</em>\r\n\r\n- Thiết kế có hình dạng thân trụ thon dài với vỏ son bằng nhựa mài lì trong suốt giúp bạn quan sát màu son bên trong dễ dàng hơn, thiết kế nổi bật độc đáo với phần nắp có màu vàng đồng nổi bật\r\n- Đầu cọ son vát nhẹ giúp bạn hình giọt nước có khoét nhỏ ở giữa cọ giúp bạn ước lượng được lượng son lấy ra, thao tác thoa son lên môi dễ dàng và tạo viền môi rõ nét, xinh xắn.\r\n- So với những dòng son kem khác của Romand chất son của dòng son kem lì Romand Milk Tea Velvet Tint đặc biệt xốp mịn và có mùi thơm dịu nhẹ dễ chịu', 'Son bibia', '', 'inherit', 'closed', 'closed', '', '297-revision-v1', '', '', '2022-11-25 13:41:51', '2022-11-25 06:41:51', '', 297, 'http://localhost:8000/wordpress/?p=358', 0, 'revision', '', 0),
