(398, 1, '2022-11-27 21:10:17', '2022-11-27 14:10:17', 'ý tưởng PR cực hay đưa ra các phần cụ thể như sau: tại nhóm nghiên cứu, xác định đối thủ, thu hút sự chú ý của công chúng, đi từ chi tiết đến khoái quát, tổ chức sự kiện truyền thông triển khai, quảng bá thương hiệu, tạo cơ hội, tạo điểm nhấn về sản phẩm của mình qua từng chuỗi hành động liên tiếp. Đây là một tài liệu được đánh giá cao để có thể hướng dư luận, hướng truyền thông vào các dự án của công ty mình.', 'dự án 12', '', 'inherit', 'closed', 'closed', '', '302-revision-v1', '', '', '2022-11-27 21:10:17', '2022-11-27 14:10:17', '', 302, 'http://localhost:8000/wordpress/?p=398', 0, 'revision', '', 0),
