(493, 1, '2022-11-30 11:05:24', '2022-11-30 04:05:24', '<div id=\"PARAGRAPH39\" class=\"ladi-element\">\r\n<ul>\r\n 	<li><a href=\"https://toprealty.vn/du-an/shizen-nami\"><img class=\"attachment-realty-thumbnail size-realty-thumbnail wp-post-image\" src=\"https://toprealty.vn/mp-up/2022/08/shizen-nami-da-nang-160x101.jpg\" alt=\"Shizen Nami Da Nang\" width=\"160\" height=\"101\" /></a>\r\n<div class=\"info-realty info-project\">\r\n<h4><a href=\"https://toprealty.vn/du-an/shizen-nami\">Shizen Nami</a></h4>\r\n<b>Địa chỉ</b>: 1A đường Nguyễn Tất Thành, Hoà Hiệp Nam, Liên Chiểu, Đà Nẵng.\r\n\r\n<b>Điện thoại</b>: 0793 233 777\r\n\r\n<b>Loại hình</b>: <a href=\"https://toprealty.vn/loai-hinh/can-ho\" rel=\"tag\">Căn hộ</a>\r\n<div><strong>Nội dung của thuyết minh dự án bao gồm:</strong></div>\r\n<div>- Sự cần thiết và mục tiêu đầu tư, đánh giá nhu cầu thị trường, tiêu thụ sản phẩm đối với dự án sản xuất, kinh doanh hình thức đầu tư xây dựng công trình, địa điểm xây dựng, nhu cầu sử dụng đất, điều kiện cung cấp nguyên liệu, nhiên liệu và các yếu tố đầu vào khác.</div>\r\n<div>- Mô tả về quy mô và diện tích xây dựng công trình, các hạng mục công trình bao gồm công trình chính, công trình phụ và các công trình khác, phân tích lựa chọn phương án kỹ thuật, công nghệ và công suất.</div>\r\n<div><strong>Các giải pháp thực hiện bao gồm:</strong></div>\r\n<div>a) Phương án giải phóng mặt bằng, tái định cư và phương án hỗ trợ xây dựng hạ tầng kỹ thuật nếu có.</div>\r\n<div>b) Các phương án thiết kế kiến trúc đối với công trình trong đô thị và công trình có yêu cầu kiến trúc.</div>\r\n<div>c) Phương án khai thác dự án và sử dụng lao động.</div>\r\n<div>d) Phân đoạn thực hiện, tiến độ thực hiện và hình thức quản lý dự án.</div>\r\n<div>- Đánh giá tác động môi trường, các giải pháp phòng, chống cháy, nổ và các yêu cầu về an ninh, quốc phòng.</div>\r\n<div>- Tổng mức đầu tư của dự án. khả năng thu xếp vốn, nguồn vốn và khả năng cấp vốn theo tiến độ.phương án hoàn trả vốn đối với dự án có yêu cầu thu hồi vốn. các chỉ tiêu tài chính và phân tích đánh giá hiệu quả kinh tế, hiệu quả xã hội của dự án.</div>\r\n</div></li>\r\n</ul>\r\n</div>', 'bán 9', '', 'publish', 'open', 'open', '', 'du-an-1-11-3-2-3', '', '', '2022-11-30 11:24:40', '2022-11-30 04:24:40', '', 0, 'http://localhost:8000/wordpress/?post_type=project&#038;p=493', 0, 'project', '', 0),
